$(document).ready(function () {

	var table = $('#example').DataTable({
		dom: 'Bfrtip',
		"processing": true,
		ajax: {
			url: _url + 'customerlog/getlistcustomer',
			"type": "GET",
			"data": function (d) {
				return $.extend({}, d, {
					"kit": $("select[id=kit]").val(),
					"com": $("select[id=com]").val(),
					"etatcontrat": $("select[id=etatcontrat]").val(),
					"datetimedeb": $("input[id=datetimedeb]").val(),
					"decision": $("select[id=decision]").val()
				});
			}
		},

		buttons: [
			{
				extend: 'print',
				messageTop: function () {
					//if (printCounter === 1) {
					return 'La flamme divine (Historique clients).';
					//} else {
					//	return 'You have printed this document ' + printCounter + ' times';
					//}
				},
				exportOptions: {
					columns: [0, 1, 2, 3]
				}
			},
			{
				extend: 'pdfHtml5',
				pageSize: 'A4',
				exportOptions: {
					columns: [0, 1, 2, 3]
				},
				customize: function (doc) {
					//Remove the title created by datatTables
					doc.defaultStyle.fontSize = '12';
					doc.content.splice(0, 1);
					var now = new Date();
					var jsDate = now.getDate() + '-' + (now.getMonth() + 1) + '-' + now.getFullYear();
					var logo = 'data:image/jpeg;base64,';
					doc.pageMargins = [45, 45, 20, 20];
					doc.styles.tableHeader.fontSize = 12;
					doc['header'] = (function () {
						return {
							columns: [
								{
									image: logo,
									width: 70
								},
								{
									alignment: 'left',
									italics: true,
									text: 'La Flamme Divine',
									fontSize: 12,
									margin: [20, 0]
								},
								{
									alignment: 'right',
									fontSize: 10,
									text: 'Historique client'
								}
							],
							margin: 20
						}
					});
					doc['footer'] = (function (page, pages) {
						return {
							columns: [
								{
									alignment: 'left',
									text: ['Créer le : ', {text: jsDate.toString()}]
								},
								{
									alignment: 'right',
									text: ['P', {text: page.toString()}, '/', {text: pages.toString()}]
								}
							],
							margin: 3
						}
					});
					var objLayout = {};
					objLayout['hLineWidth'] = function (i) {
						return .5;
					};
					objLayout['vLineWidth'] = function (i) {
						return .5;
					};
					objLayout['hLineColor'] = function (i) {
						return '#aaa';
					};
					objLayout['vLineColor'] = function (i) {
						return '#aaa';
					};
					objLayout['paddingLeft'] = function (i) {
						return 4;
					};
					objLayout['paddingRight'] = function (i) {
						return 4;
					};
					doc.content[0].layout = objLayout;
				}

			}
		],
		"columns": [
			/*{title: "Nom client", data: "nameCustomer"},
			{title: "Prénom client", data: "surnameCustomer"},
			{title: "Sexe", data: "sexeCustomer"},
			{title: "Adresse", data: "adresseCustomer"},
			{title: "Recouvrement", data: "sommetotal"},
			{title: "Actions",}*/

			{title: "Nom client", data: "namecustomer"},
			{title: "N° contrat", data: "contrat"},
			{title: "nom Kit", data: "nomkit"},
			{title: "Quantité", data: "Qte"},
			//{title: "Recouvrement", data: "sommeTotal"},
			{title: "Actions"}
		],
		"columnDefs": [{
			"targets": 4,
			render: function (data, type, row, meta) {
				return '<div class="dropdown"> ' +
					'<div class="btn btn-sm btn-brown more-btn"> Actions ' +
					'<span class="caret"></span> ' +
					'</div><ul class="dropdown-menu">' +
					'<li>' +
					'<a style="color:black;" target="_blank" href="' + _url + 'customer/viewcust?id=' + row.idCustomer + '"><i class="fa fa-eye"> </i> Détails</a> ' +
					'</li> ' +
					'</ul> ' +
					'</div>';
			}
		}],
		'rowsGroup': [0],
		retrieve: true,
		"paging": true,
		"lengthChange": true,
		"searching": true,
		"ordering": false,
		"info": false,
		"autoWidth": true,
		"bFilter": false,
		"pageLength": 10,
		"language": {
			"url": __url + "assets/js/others/French.json"
		}
	});


	jQuery("#search").click(function () {
		table.ajax.reload(null, false);
	});


});
